import React from "react";
import { FaFacebookF, FaLinkedinIn, FaTwitter } from "react-icons/fa";

// into TeamOne
let teamData = [
  {
    images: "01",
    name: "Brigadier(Retd) Sajjad Sardar ",
    title: "Core Member",
    designation: "Space Scientist",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "02",
    name: "Syed Wajahat Hussain",
    title: "Core Member",
    designation:
      "An engineer with experience of over thirty years in Product Development, International Trade",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
    ],
  },
  {
    images: "03",
    name: "Dr Akhtar Hussain",
    title: "Core Member",
    designation:
      "Over twenty five years of experience in Software Suite development as well as Geographic Information System.",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "04",
    name: "Syed Muhammad Abbas",
    title: "Core Member",
    designation:
      "A business executive with experience in Economics and Business Management having expertise in Business Mapping and Ergonomics",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
];

// into TeamTwo
let advisors = [
  {
    images: "01",
    name: "Dr Yarjan Abdul Samad",
    title: "Advisor",
    designation: "Space Scientist",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "02",
    name: "Dr Syed Ali Raza",
    title: "Advisor",
    designation:
      "Expertise in Artificial Intelligence, Wireless Networking and Internet of Things.",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
    ],
  },
  {
    images: "03",
    name: "Dr Syed Najam Abbas",
    title: "Advisor",
    designation:
      "Head of the Space Science Department, Institute of Space Technology.",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "04",
    name: "Dr Jamil H Kazmi",
    title: "Advisor",
    designation:
      "Meritorious Professor and a seasoned Geographer with a distinguished career.",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "05",
    name: "Dr Ghulam Muhammad Mehdi",
    title: "Advisor",
    designation:
      "Expertise in Machine Learning, Deep Learning and Algorithms Development.",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
];

// into TeamOne
export default teamData;
